var mip = {
    ajax: function(url,param,type){
        if (type !== 'global') {
            url = mipGlobal.rewrite + url;
        }
        return new Promise(function(resolve, reject){
            axios.post(url,param).then(function (res) {
                if (res.status == 200) {
                    if(res.data.code == undefined) {
                        Vue.prototype.$message({
                            type: 'error',
                            message: res.data
                        });
                        return false;
                    }
                    if (res.data.code == 1005) {
                        axios.post('/ApiUser/Api_User_user/loginOut','').then(function (res) {
                            location.href = "/login.html";
                        });
                    }
                    if (res.data.code != 200 && res.data.code != 1 &&  res.data.code != -1 ) {
                        Vue.prototype.$message({
                            type: 'error',
                            message: res.data.msg + ' 错误代码:' +res.data.code
                        });
                    } else {
                        resolve(res.data);
                    }
                } else {
                    Vue.prototype.$message({
                        type: 'error',
                        message: '系统错误'
                    });
                }
            }, function(err){
                if (err.config.url == '/install/installPost') {
                    if (err.response.status == 404) {
                        if (err.response.headers.server.indexOf('nginx') > -1) {
                            Vue.prototype.$message({
                                type: 'error',
                                message: '404错误，nginx环境需要配置伪静态规则'
                            });
                        } else {
                            Vue.prototype.$message({
                                type: 'error',
                                message: '404错误，您需要配置环境的伪静态'
                            });
                        }
                    }
                    if (err.response.status == 500) {
                        Vue.prototype.$message({
                            type: 'error',
                            message: '500错误,如果是mysql5.7 请降低版本'
                        });
                        return false;
                    }
                } else {
                    Vue.prototype.$message({
                        type: 'error',
                        message: '系统错误，错误代码：' + err.response.status
                    });
                }
            })
        });
    },
}

Vue.prototype.$mip = mip;

Vue.prototype.$isLogin = function() {
    if (!mipGlobal.userId) {
        this.$confirm('您尚未登陆，请先登录', '信息提示', {
            confirmButtonText: '去登录',
            cancelButtonText: '取消',
        }).then(() => {
            window.location.href = '/login.html'
        }).catch(() => {
        });
        return false;
    } else {
        return true;
    }
}

